import React from 'react';
import { Container } from 'react-bootstrap';
import "./Footer.css"

export default function Footer(){
    return(
        <footer class="footer">
            <div class="container">
                <div class="row">
                    <div className="col-3 text-center">
                        <h2 className="footer-title">Picted</h2>
                    </div>
                </div>
            </div>
        </footer>
    )
}
